import React from 'react'
import Navbar from "./Navbar";
import Footer from "../components/footer/Footer";
import Searchbar from "../components/carbontracker/Searchbar";
import Card2 from "../components/carbontracker/Card2";
import ChickenRice from "./ChickenRice.jpg";
import CaeserSalad from "./CaeserSalad.jpeg";
import TonkatsuRamen from "./TonkotsuRamen.jpeg"
import Laksa from "./Laksa.jpeg";
import KoreanTofuSoup from "./KoreanTo"




const CarbonTracker = () => {
  return (
    <div className="items-center">
      {/* <Navbar /> */}
      <Searchbar />

      {/* <div class=" container my-12 mx-auto px-4 md:px-12 items-center">
        <div class="flex flex-wrap lg:-mx-4 items-center mx-60 grid-rows-3"> */}
      <div class="container my-12 mx-auto px-4 md:px-12">
        <div class="flex flex-wrap -mx-1 lg:-mx-4">
          <Card2 DishTitle={"Singapore Chicken Rice"} DishImage={ChickenRice} />
          <Card2 DishTitle={"Caeser Salad"} DishImage={CaeserSalad} />
          <Card2 DishTitle={"Tonkatsu Ramen"} DishImage={TonkatsuRamen} />
          <Card2 DishTitle={"Korean Tofu Soup"} DishImage={CaeserSalad} />
          <Card2 DishTitle={"Nasi Lemak"} DishImage={CaeserSalad} />
          <Card2 DishTitle={"Steak and Fries"} DishImage={CaeserSalad} />
          <Card2 DishTitle={"Laksa"} DishImage={Laksa} />
        </div>
      </div>
    </div>
  );
}

export default CarbonTracker
